C.Io=new L.cC("The COVID-19 pandemic originated in Wuhan, located in China, and has quickly spread to various countries, with many cases and casualities reported worldwide. Multiple strategies have been adopted so far and many more are essential to handle the present outbreak. These include computational modeling, statistical analysis and quantitative analysis to regulate the spread because of the rapid development of replacement treatment.\n\nEver since the outbreak of this virus in India, there have been lots of ups and downs in the number of cases in various regions. The MOHFW (Ministry of Health and Family Welfare of India) has raised awareness about the recent outbreak and has taken necessary actions to manage the spread of COVID-19. While some areas performed better at mitigating the outbreak, some came close to collapsing. Not only that, but the data indicates that the geographical factors like terrain, climate, pollution etc. have had a huge role in deciding the extent of the pandemic so far. Places with a hot and humid climate like Maharashtra showed a steep rise in the number of cases whereas regions with a rather cold and dry climate like Jammu seemed almost immune to the spread of the virus.\n\nKeeping in mind the devastating consequences of the virus outbreak and the inevitable third wave of the pandemic, it is necessary to be prepared with mitigating measures to ensure minimum spread and effect of the virus.",C.cV,null,null,null)
